INSERT INTO `policies` (`id`, `type`, `title`, `content`, `created_at`, `updated_at`) VALUES
(1, 'site_mape', 'sitemap', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<h2 id=\"store-name-privacy-policy\" style=\"box-sizing: border-box; font-family: proxima-nova, sans-serif; font-weight: 500; line-height: 1.3em; color: #444444; margin: 20px 0px 15px; font-size: 30px; -webkit-font-smoothing: antialiased;\">&nbsp;</h2>\r\n</body>\r\n</html>', '2020-07-12 09:40:37', '2020-10-22 03:54:30'),
(2, 'payment', 'Payment Policy', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Payment Policy</p>\r\n</body>\r\n</html>', '2020-07-12 09:43:47', '2020-07-12 09:43:47'),
(3, 'shipping', 'Shipping Policy', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Shipping Policy</p>\r\n</body>\r\n</html>', '2020-07-12 09:44:11', '2020-07-12 09:44:11'),
(4, 'privacy', 'Privacy Policy', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>GRAND BAZAAR- Privacy Policy</p>\r\n<p>This Privacy Policy describes how your personal information is collected, used, and shared when you visit or make a purchase from www.grandbazaar.com.bd</p>\r\n<p>&nbsp;<span style=\"color: #800000; background-color: #ffffff;\"><strong>WHAT PERSONAL INFORMATION WE COLLECT</strong></span></p>\r\n<p>When you visit the Site, we automatically collect certain information about your device, including information about your web browser, IP address, time zone, and some of the cookies that are installed on your device.</p>\r\n<p>&nbsp;Additionally, as you browse the Site, we collect information about the individual web pages or products that you view, what websites or search terms referred you to the Site, and information about how you interact with the Site. We refer to this automatically collected information as Device Information.</p>\r\n<p>&nbsp;<strong><span style=\"color: #800000;\">We collect Device Information using the following technologies:</span></strong></p>\r\n<p>Cookies are data files that are placed on your device or computer and often include an anonymous unique identifier.</p>\r\n<p>Log files track actions occurring on the Site, and collect data including your IP address, browser type, Internet service provider, referring/exit pages, and date/time stamps.</p>\r\n<p>Mention all other tracking tools and/or technologies being used by your website.</p>\r\n<p>Also, when you make a purchase or attempt to make a purchase through the Site, we collect certain information from you, including your name, billing address, shipping address, payment information (including credit card numbers Mention all types of accepted payments, email address, and phone number. This is called Order Information.</p>\r\n<p>Make sure you mention all other information that you collect.</p>\r\n<p>By Personal Information in this Privacy Policy, we are talking both about Device Information and Order Information.</p>\r\n<p><span style=\"color: #800000;\"><strong>HOW DO WE USE YOUR PERSONAL INFORMATION</strong></span></p>\r\n<p>We use the Order Information that we collect generally to fulfil any orders placed through the Site (including processing your payment information, arranging for shipping, and providing you with invoices and/or order confirmations).</p>\r\n<p>Additionally, we use this Order Information to: - Communicate with you. - Screen our orders for potential risk or fraud. - When in line with the preferences you have shared with us, provide you with information or advertising relating to our products or services.</p>\r\n<p>We use the Device Information that we collect to help us screen for potential risk and fraud (in particular, your IP address), and more generally to improve and optimize our Site.</p>\r\n<p>&nbsp;<span style=\"color: #800000;\"><strong>SHARING YOUR PERSONAL INFORMATION</strong></span></p>\r\n<p>&nbsp;We share your Personal Information with third parties to help us use your Personal Information, as described above.</p>\r\n<p>&nbsp;We also use Google Analytics to help us understand how our customers use grand bazaar. How Google uses your Personal Information.</p>\r\n<p>&nbsp;Finally, we may also share your Personal Information to comply with applicable laws and regulations, to respond to a subpoena, search warrant or other lawful requests for information we receive, or to otherwise protect our rights.</p>\r\n<p>&nbsp;<span style=\"color: #800000;\"><strong>BEHAVIOURAL ADVERTISING</strong></span></p>\r\n<p>&nbsp;We use your Personal Information to provide you with targeted advertisements or marketing communications we believe may be of interest to you.</p>\r\n<p>&nbsp;Mention opt-out links from external services such as:</p>\r\n<ul>\r\n<li>&nbsp;Facebook</li>\r\n<li>&nbsp;Google</li>\r\n</ul>\r\n<p>You can opt out of targeted advertising...</p>\r\n<p>&nbsp;<span style=\"color: #800000;\"><strong>YOUR RIGHTS</strong></span></p>\r\n<p>you have the right to access the personal information we hold about you and to ask that your personal information is corrected, updated, or deleted. If you would like to exercise this right, please contact us.</p>\r\n<p>Additionally, we note that we are processing your information in order to fulfil contracts we might have with you (for example if you make an order through the Site), or otherwise to pursue our legitimate business interests listed above.</p>\r\n<p>Please note that your information will be transferred outside of Europe, including to Canada and the United States.</p>\r\n<p>&nbsp;<span style=\"color: #800000;\"><strong>DATA RETENTION</strong></span></p>\r\n<p>When you place an order through the Site, we will maintain your Order Information for our records unless and until you ask us to delete this information.</p>\r\n<p>&nbsp;<span style=\"color: #800000;\"><strong>MINORS</strong></span></p>\r\n<p>The Site is not intended for individuals under the age of 18.</p>\r\n<p>&nbsp;<span style=\"color: #800000;\"><strong>CHANGES</strong></span></p>\r\n<p>We may update this privacy policy from time to time in order to reflect, for example, changes to our practices or for other operational, legal or regulatory reasons.</p>\r\n<p><span style=\"color: #808080;\">If you have questions and/or require more information, do not hesitate to contact us</span> .</p>\r\n</body>\r\n</html>', '2020-07-12 09:44:31', '2020-10-22 03:48:03');
